const buttonFullTable=document.querySelector("#full"),tableResults=document.querySelector(".results__table");buttonFullTable.addEventListener("click",()=>{tableResults.classList.contains("full-table")?(tableResults.classList.remove("full-table"),buttonFullTable.textContent="Посмотреть полностью"):(tableResults.classList.add("full-table"),buttonFullTable.textContent="Свернуть")});